CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `sp_consultar_usuario` (IN `p_email` VARCHAR(100), IN `p_contrasena` VARCHAR(255), OUT `p_estado` INT)   BEGIN
    DECLARE v_contrasena_db VARCHAR(255);
    DECLARE v_intentos_fallidos INT;
    DECLARE v_estado INT;

    -- Verificar si el usuario existe y obtener su estado y contraseña
    SELECT contrasena, intentos_fallidos, estado 
    INTO v_contrasena_db, v_intentos_fallidos, v_estado 
    FROM usuario 
    WHERE email = p_email;

    -- Checar si el usuario esta habilitado
    IF v_estado = 0 THEN
        SET p_estado = -1; -- Usuario deshabilitado
    ELSE
        -- Validar la contraseña
        IF v_contrasena_db = p_contrasena THEN
            -- Si la contra es correcta reinicia el contador de intentos y retorna exito
            UPDATE usuario 
            SET intentos_fallidos = 0 
            WHERE email = p_email;
            SET p_estado = 1; -- Inicio de sesion exitoso
            
            -- Devolver información del usuario en caso de inicio de sesión exitoso
            SELECT nombre_usuario, telefono, tipo_usuario, email
            FROM usuario 
            WHERE email = p_email;
            
        ELSE
            -- Si la contra esta equivocada agrega +1 a los intento fallidos
            SET v_intentos_fallidos = v_intentos_fallidos + 1;
            UPDATE usuario 
            SET intentos_fallidos = v_intentos_fallidos 
            WHERE email = p_email;

            -- Checar si se debe deshabilitar a el usuaro
            IF v_intentos_fallidos >= 3 THEN
                UPDATE usuario 
                SET estado = 0 
                WHERE email = p_email;
                SET p_estado = -1; -- Usuario deshabilitado despues de 3 intentos
            ELSE
                SET p_estado = 0; -- Intento fallido, pero la cuenta sigue activa
            END IF;
        END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `sp_crear_categoria` (IN `p_nombre` VARCHAR(100), IN `p_descripcion` TEXT)   BEGIN
 INSERT INTO categoria (nombre, descripcion)
    VALUES (p_nombre, p_descripcion);
END$$

CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `sp_crear_usuario` (IN `p_nombre_usuario` VARCHAR(100), IN `p_nombre` VARCHAR(100), IN `p_apellidos` VARCHAR(100), IN `p_email` VARCHAR(100), IN `p_contrasena` VARCHAR(255), IN `p_tipo_usuario` TINYINT, IN `p_foto` BLOB, IN `p_fecha_nacimiento` DATE, IN `p_telefono` BIGINT, IN `p_biografia` TEXT, IN `p_cuenta_bancaria` VARCHAR(50))   BEGIN
 -- Validar si el email ya existe
    IF EXISTS (SELECT 1 FROM usuario WHERE email = p_email) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El email ya está en uso';
    ELSE
        -- Insertar el nuevo usuario
        INSERT INTO usuario (nombre_usuario, nombre, apellidos, email, contrasena, tipo_usuario, foto, fecha_nacimiento, telefono, biografia, cuenta_bancaria)
        VALUES (p_nombre_usuario, p_nombre, p_apellidos, p_email, p_contrasena, p_tipo_usuario, p_foto, p_fecha_nacimiento, p_telefono, p_biografia, p_cuenta_bancaria);
    END IF;
END$$

CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `sp_filtro_usuario` (IN `p_email` VARCHAR(100))   BEGIN
    SELECT 
        
        nombre_usuario, 
        nombre,
        email, 
        telefono, 
        tipo_usuario,
        foto
    FROM 
        usuario 
    WHERE 
        email = p_email;
END$$

